import React from 'react';
import { test } from './components/readFile.js';

function App() {
  test()

  const lines = fileContent.split('\n');
  lines.splice(0, 1);
  lines.splice(0, 1, 'id,name,govsystem,x,y,race,prod,activity,tag,civlevel,planetsize,SC');
  const newFileContent = lines.join('\n');
  console.log(newFileContent.replace(/ /g, ','));

  return (
    <div>
      <p>{newFileContent}</p>
    </div>
  );
}

export default App;
